sub new{
  my($class,$city,$day) = @_;
  my $self = {city => $city,day => $day};
  bless $self,$class;
  return $self;
}

sub get_ref{
   my $url = shift;
   my $ua = LWP::UserAgent->new;
   my $response = $ua->get($url);
   my $ref;
   if($response->is_success){
    $ref = decode_json($response->content);
   }
   $ref;
}

sub get_city{
  my $url = URI->new(\"http://weather.livedoor.com/forecast/webservice/json/v1\");
  my $city_id = shift;
  my $city;
  $city = $url.\"?city=$city_id\";
  $city;
}

